import React, { useState, useEffect, Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Collapse from "@material-ui/core/Collapse";
import IconButton from "@material-ui/core/IconButton";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Typography from "@material-ui/core/Typography";
import Paper from "@material-ui/core/Paper";
import KeyboardArrowDownIcon from "@material-ui/icons/KeyboardArrowDown";
import KeyboardArrowUpIcon from "@material-ui/icons/KeyboardArrowUp";
import Container from "@material-ui/core/Container";
import Icon from "@material-ui/core/Icon";
import CustomerTable from "./Customer";
import Pagination from "./Pagination";

import { userTypeURL } from "../../constants";
import { authAxios } from "../../utils";

function OrderIndex() {
  const [userType, setUserType] = useState(null);
  const [loading, setLoading] = useState(false);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const findUserType = async () => {
      setLoading(true);
      const res = await authAxios.get(userTypeURL);
      setUserType(res.data);
      setLoading(false);
    };

    findUserType();
  }, []);

  if (userType == "is_delivery_staff") {
    return <div>{/* <DeliveryStaffTable /> */}</div>;
  } else if (userType == "is_shop_owner") {
    return <div>{/* <OwnerTable /> */}</div>;
  } else {
    return (
      <div>
        <CustomerTable orders={orders} />
      </div>
    );
  }
}
export default OrderIndex;
